import './UserInputComponent.css';

export const UserInputComponent =({label1,label2,img,label2status})=>{
    return(
        <section id="user-input">
       <div>        
        <label>{label1}</label> 
        <label>{label2}</label>     
        </div>      
        <input type="number">{img}</input>     
        </section>
    )
}
